import React, { Component } from 'react';
import { format } from 'date-fns';
import TimeRange, {
  UpdateCallbackData,
} from '../../components/TimelineSlider/App';
import { randomTimes, selectedInterval, timelineInterval } from './datesSource';

interface AppState {
  selectedInterval: [Date, Date];
}

const Split = () => {
  const [state, setState] = useState<AppState>({
    error: false,
    selectedInterval,
  });
  const onChangeCallback = (selectedInterval: [Date, Date]) =>
    setState({ ...state, selectedInterval });

  const { selectedInterval, error } = state;
  return (
    <div>
      <div
        style={{
          width: '80vw',
          height: '60vh',
          margin: '24px auto',
          background: '#fff',
          borderRadius: '20px',
        }}
      >
        캔버스 영역
      </div>
      <div
        style={{
          padding: '16px',
          /* height: '20vh', */
          background: '#fff',
        }}
      >
        <div className="container">
          <div className="info" style={{ fontSize: '20px' }}>
            {selectedInterval.map((d, i) => (
              <span key={i}>{format(d, 'dd MMM, HH:mm')}</span>
            ))}
          </div>

          <TimeRange
            selectedInterval={selectedInterval}
            timelineInterval={timelineInterval}
            onChangeCallback={onChangeCallback}
            randomTimes={randomTimes}
          />
        </div>
      </div>
    </div>
  );
};
export default Split;
